import React from 'react'
import { View, Text, StyleSheet, FlatList } from 'react-native'

import ImageDetail from '../components/ImageDetail'

const ImageScreen = () => {
    const list = [
        {title: "A", url: "https://picsum.photos/100"},
        {title: "B", url: "https://picsum.photos/100"},
        {title: "C", url: "https://picsum.photos/100"},
        {title: "D", url: "https://picsum.photos/100"},
        {title: "E", url: "https://picsum.photos/100"},
        {title: "F", url: "https://picsum.photos/100"},
        {title: "G", url: "https://picsum.photos/100"},
        {title: "H", url: "https://picsum.photos/100"},
        {title: "I", url: "https://picsum.photos/100"},
        {title: "J", url: "https://picsum.photos/100"},
    ]

    return (
        <View>
            <Text>
                ImageScreen
            </Text>
            <View style={style.imagesContainer}>
                <FlatList
                    data={list}
                    renderItem={(el) => {
                        return <ImageDetail
                            title={el.title}
                            url={el.url}
                        />

                    }}


                />


            </View>
        </View>

    );
}

const style = StyleSheet.create({
    imagesContainer: {
        paddingVertical: 50
    }

})

export default ImageScreen;
